import HocA from './HocA'
import HocB from './HocB'

function HocMain(MyComponent) {

    
    class HocMain extends Component {
        render() {
            return (
                <div>HocMain</div>
            )
        }
    }
    return (
        <>
            <div>HocMain</div>
            <HocA/>
            <HocB/>
        </>
    )
}

export default HocMain
